{
  "$schema": "http://json-schema.org/draft-04/schema#",
  "type": "object",
  "properties": {
    "Payload": {
      "type": "object",
      "properties": {
        "amount_base": {
          "type": "string",
          "description": "amount of base currency which user gets."
        },
        "is_default_rule": {
          "type": "boolean",
          "description": "if True any incoming funds will be converted automatically (**To** the withdraw_address defined on the same order)."
        },
        "pair": {
          "type": "object",
          "properties": {
            "name": {
              "type": "string",
              "description": "name of the pair. i.e. BTCLTC for base BTC(bitcoin) and quote LTC(litecoin) pair."
            },
            "base": {
              "type": "object",
              "properties": {
                "code": {
                  "type": "string",
                  "description": "currency code."
                },
                "name": {
                  "type": "string",
                  "description": "currency name."
                },
                "min_confirmations": {
                  "type": "number",
                  "description": "minimum number of confirmations required to approve a transaction on this currency's blockchain. Only relevant for currencies that have 'is_crypto' = true"
                },
                "is_crypto": {
                  "type": "boolean",
                  "description": "if true, this is a crypto currency, else it is a fiat currency."
                },
                "minimal_amount": {
                  "type": "string",
                  "description": "minimal amount allowed on this currency transaction."
                },
                "is_base_of_enabled_pair": {
                  "type": "boolean",
                  "description": "true if where is pair with this currency as base."
                },
                "is_quote_of_enabled_pair": {
                  "type": "boolean",
                  "description": "true if exists a pair with this currency as quote."
                },
                "has_enabled_pairs": {
                  "type": "boolean",
                  "description": "true if pair with this currency as base or quote and enabled exchange exists."
                }
              },
              "required": [
                "code"
              ],
              "description": "base currency."
            },
            "quote": {
              "type": "object",
              "properties": {
                "code": {
                  "type": "string",
                  "description": "currency code."
                },
                "name": {
                  "type": "string",
                  "description": "currency name."
                },
                "min_confirmations": {
                  "type": "number",
                  "description": "minimum number of confirmations required to approve a transaction on this currency's blockchain. Only relevant for currencies that have 'is_crypto' = true"
                },
                "is_crypto": {
                  "type": "boolean",
                  "description": "if true, this is a crypto currency, else it is a fiat currency."
                },
                "minimal_amount": {
                  "type": "string",
                  "description": "minimal amount allowed on this currency transaction."
                },
                "is_base_of_enabled_pair": {
                  "type": "boolean",
                  "description": "true if where is pair with this currency as base."
                },
                "is_quote_of_enabled_pair": {
                  "type": "boolean",
                  "description": "true if exists a pair with this currency as quote."
                },
                "has_enabled_pairs": {
                  "type": "boolean",
                  "description": "true if pair with this currency as base or quote and enabled exchange exists."
                }
              },
              "required": [
                "code"
              ],
              "description": "quote currency."
            },
            "fee_ask": {
              "type": "number",
              "description": "asking fee, 0.001 equals 0.1%."
            },
            "fee_bid": {
              "type": "number",
              "description": "biding fee, 0.001 equals 0.1% (depreciated)."
            }
          },
          "required": [
            "name",
            "base",
            "quote",
            "fee_ask",
            "fee_bid"
          ],
          "description": "exchanged pair."
        },
        "withdraw_address": {
          "type": "object",
          "properties": {
            "type": {
              "type": "string",
              "description": "\"W\" for withdraw and \"D\" for Deposit."
            },
            "name": {
              "type": [
                "string",
                "null"
              ],
              "description": "name of the address."
            },
            "address": {
              "type": "string",
              "description": "crypto currency address i.e. 0x408a05c9F62E8eaECd258BB27213ee6e59d2E7Ef"
            },
            "currency_code": {
              "type": "string",
              "description": "currency code i.e. ETH."
            }
          },
          "required": [
            "type",
            "address",
            "currency_code"
          ],
          "description": "a destination address to which the funds will be dispatched upon the successful completion of the Order."
        }
      },
      "required": [
        "amount_base",
        "is_default_rule",
        "pair",
        "withdraw_address"
      ]
    },
    "Headers": {
      "type": "object",
      "properties": {
        "Content-Type": {
          "type": "string",
          "description": "application/json."
        }
      },
      "required": [
        "Content-Type"
      ]
    }
  }
}
